import { Image, Text, Platform } from "react-native";
import React from 'react';
import { View } from "react-native";
let imgSrc = require('./docteur.png');
const Receveur = () => {
    return <View>
                <Text>Test pour le web</Text>
                if (Platform.OS !== 'web'){
                <Image source={imgSrc}/>}
                else {<img src={imgSrc}/>}
            </View>
}
export default Receveur
